## 3) Presence & Absence - Host Invertebrate Taxonomy (Genus)

# Generating Sorensen Dissimilarity Matrix:
presence_absence_2017_genus <- read.csv("/data/shawn/2017_Multivariate_Analysis/presence_absence_2017_genus.csv")
presence_absence_2017_genus <- as.data.frame(presence_absence_2017_genus)
row.names(presence_absence_2017_genus) <- presence_absence_2017_genus$Genus
presence_absence_2017_genus <- presence_absence_2017_genus[,-1]
presence_absence_2017_genus_DM <- vegdist(presence_absence_2017_genus, method = "bray", binary = TRUE)

# Unconstrained Principal Coordinates Analysis (PCoA)
presence_absence_2017_genus.ord <- dbrda(presence_absence_2017_genus_DM ~ 1, add = TRUE)
summary(presence_absence_2017_genus.ord)
PCoA_scores <- scores(presence_absence_2017_genus.ord, display="si")
SampleID_scores <- data.frame(PCoA_scores)

# Assign Taxonomy
variables_2017 <- read.csv("/data/shawn/2017_Multivariate_Analysis/variables_2017.csv")
variables_2017 <- as.data.frame(variables_2017)
row.names(variables_2017) <- variables_2017$SampleID
variables_2017 <- variables_2017[,-1]
Genus <- variables_2017$Genus
SampleID_scores$Genus <- Genus

# Calculate Multivariate Dispersions Using Betadisper
mod <- betadisper(presence_absence_2017_genus_DM, SampleID_scores$Genus)

# Permutation Test
permutest(mod, pairwise = TRUE, permutations = 999)

# Tukey's Honest Significant Differences
(mod.HSD <- TukeyHSD(mod))
plot(mod.HSD)


